'use strict';
let MessageType = require('./MessageType.js');
class GetPriceFeedMessage {
    symbol;
    requestId;
    offerId;
    error;
    offer;
    constructor() {
        this.symbol = null;
        this.requestId = null;
        this.error = null;
        this.offerId = null;
        this.offer = null;
    }
    getType() {
        return MessageType.PriceFeed;
    }
    getSymbol() {
        return this.symbol;
    }
    getRequestId() {
        return this.requestId;
    }
    getOfferId() {
        return this.offerId;
    }
    getError() {
        return this.error;
    }
    getOffer() {
        return this.offer;
    }
}
module.exports = GetPriceFeedMessage
